import React from "react";

export default function Nav(props) {
  return (
    <div className="container-nav">
      <nav>
        <h1>todo</h1>
        <ul>
          <li>home</li>
          <li>pricing</li>
          <li>about</li>
        </ul>
      </nav>
    </div>
  );
}
